import React from "react";

function Recipe(props) {
    return (
        <div>
            <h1> {props.name} </h1>
            <h2> These are the following ingredients that you need: </h2>
            <p> {props.ingredients} </p>
            <h2> Here are the Steps for the Recipe:  </h2>  
            <p> {props.instructions}</p> 
        </div>
    )
}

export default Recipe;
